import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import cardStuff from './cards.jsx';
import { Card, Button, Container, Col, Row, } from 'react-bootstrap'

function App() {
  return (
    <div className="App">
      <header className='App-header'>


      <cardStuff></cardStuff>
      <cardStuff></cardStuff>
      <cardStuff />  
      <Button1 />


      </header>

    </div>
  );
}

function Button1() {
  return (
  <div>
  <Button>Did this work Scott???</Button>
  </div>
  );
}
export default App;
